import "./PageTwo.css"
import backDrawing from "../../img/Rectangle 13.png"
import frontDrawing from "../../img/Rectangle 12.png"

function PageTwo() {
    return(
        <div className="container">
            <div className="row">
                <div className="col-lg-6 col-md-3">
                    <img src={ backDrawing } className="backDrawing" />
                    <img src={ frontDrawing } className="fontDrawing" />

                </div>
                <div className="col-lg-6 col-md-3"></div>
            </div>
        </div>
    );
}

export default PageTwo;
